var parser,rotator,_timeout,_duration;function init(){var a=getConfig();_duration=(parseInt(a.duration)||15)*1000;initExits();parser=new FeedParser();parser.fetch(a,onSuccess,onFail)}function onSuccess(a){log("onSuccess("+a.length+"results)");document.getElementById("loader").style.display="none";if(!a.length){onFail({duration:0});return}log(a);rotator=new Rotator(document.getElementById("slider"),"item-template",isMobile());rotator.addEventListener(Rotator.CHANGE,onPageChange);rotator.init(a,parseInt("19"),parseInt("26"),true);initControls()}function onFail(a){log("onFail("+a.duration+" secs)");document.getElementById("fallback").style.display="block"}function onPageChange(a){log("onPageChange() - "+a.index+", "+a.touch);if(document.querySelector("#title")){document.querySelector("#title").textContent=a.data.parent.EventName}}function onBannerExpired(){log("onBannerExpired()");rotator.stop()}function validate(d){var a=d.length,c;var b=2;for(c=0;c<d.length;c++){try{if(toArray(d[c].Market)[0].EventSelections.length<b){d.splice(c--,1)}}catch(e){d.splice(c--,1)}}log("validate("+a+" -> "+d.length+" results)");return d}function initExits(){if(!Enabler.isInitialized()){throw new Error("initExits() - Enabler not ready")}$("#main")[0].addEventListener("click",function(a){a.stopPropagation();log("Background Exit");Enabler.exit("Background Exit")});$("#slider")[0].addEventListener("click",function(a){a.stopPropagation();log("Odds Exit");Enabler.exit("Odds Exit")})};